import logo from './logo.svg';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import Home from './Components/Home/Home.js';
import Navbar from './Components/Navbar/Navbar';

function App() {
  return (
    <Navbar>
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
    </Navbar>
  );
}

export default App;
